import React, { useEffect, useState } from 'react';
import { AuthContext } from '../AuthContext';
import { useNavigate } from 'react-router-dom';

export default function Dashboard() {
  const [rekening, setRekening] = useState([]);
  const history = useNavigate();
  const { isUserAuthenticated, idU, logoutU } = React.useContext(AuthContext);

  if (!isUserAuthenticated) {
    history('/login-user');
  }

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:3000/rekening'); // Endpoint API Express
        if (!response.ok) {
          throw new Error('Gagal mendapatkan data rekening');
        }
        const data = await response.json();
        setRekening(data);
        console.log(data);
      } catch (error) {
        console.error('Error:', error);
      }
    };
    fetchData();
  }, []);

  return (
    <div class="container-fluid">
      <div class="row">
        <nav class="navbar navbar-expand-lg sticky-top bg-primary navbar-dark">
          <div class="container">
            <a class="navbar-brand" >Dashboard User</a>
            <ul class="navbar-nav ms-auto mb-2 mb-lg-0">

              <li class="nav-item">
                <a class="btn bg-white text-primary ms-4 hover:bg-sky-900" onClick={logoutU}>Sign Out</a>
              </li>
            </ul>
          </div>
        </nav>

        <nav id="sidebar" class="col-md-3 col-lg-2 d-md-block bg-cyan-950 h-screen  sidebar">
          <div class="sidebar-sticky pt-3">
            <ul class="nav flex-column">
              <li class="nav-item">
                <a class="nav-link text-white text-primary active" aria-current="page" href="/dashboard-user">
                  All Account
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link text-white text-primary " href="/dashboard-user/create">
                  Create Account
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link text-white text-primary" href="manage-games.html">
                  Manage Games
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link text-white text-primary" href="profile.html">
                  User Profile
                </a>
              </li>
            </ul>
          </div>
        </nav>

        <main class="col-md-9 ms-sm-auto col-lg-10 px-md-4 jus">
          <div>
            <div className='flex gap-4 bg-slate-500'>
              <div>
                Nama
              </div>
              <div>
                Bank
              </div>
            </div>
            <ul>
              {rekening.map((item) => (
                <li key={item.ID}>
                  <strong>Pemilik:</strong> {item.Pemilik},
                  <strong> Nama Bank:</strong> {item.NamaBank},
                  <strong> No Kartu:</strong> {item.NoKartu},
                  <strong> Pin:</strong> {item.Pin}
                </li>
              ))}
            </ul>
          </div>
        </main>
      </div>
    </div>


  );
}
